import React from 'react'
import './Items.css'
import { CurrencyRupeeOutlined } from '@mui/icons-material'
import { BiCart, BiCartAlt } from 'react-icons/bi'
import data from '../../utils1/resto.json'

const Items = () => {
    return (
      <div>
        {data.map((restaurant) =>
          restaurant.items.map((item) => (
            <div className="main1" key={item.id}>
              <img src={item.img} alt="food" className="item-img" />
              <div className="main2 flexColCenter">
                <p className="item-name">{item.name}</p>
                <div className="flexCenter">
                  <CurrencyRupeeOutlined />
                  <p className="item-price">{item.price}</p>
                </div>
                <button className="button">
                  <BiCart className="item-cart" />
                </button>
              </div>
            </div>
          ))
        )}
      </div>
    );
  };
  
  export default Items;
